part of 'schedule_cubit.dart';@immutableabstract class ScheduleState {}class ScheduleInitial extends ScheduleState {}class ScheduleLoading extends ScheduleState {}class ScheduleSuccess extends ScheduleState {  final List<ScheduleModel> schedules;  ScheduleSuccess({required this.schedules});}class ScheduleError extends ScheduleState {  final String message;  ScheduleError({required this.message});}